import React from 'react';
import {
    FaArrowLeft,
    FaArrowRight,
    FaSearch
}from "react-icons/fa";

const Files = () => {
    return (
        <div class="container2">
            <div class="topnav">
                <a href="#" ><FaArrowLeft/></a>
                <a href="#" class="RedoButton"><FaArrowRight/></a>
                <div class="searchbar">
                    <p><FaSearch/>&ensp; Search</p>
                </div>
            </div><div class="content">
            <h1>Files page</h1>
        </div></div>
    );
};

export default Files;
